Mighty GirlzMG - Aug 07, 2012 - Marie McCray


Mp4 + Pics


Did Sinnful's entrance and immediate fall signify the end for our duo? Flame finds herself caged as her once dynamic partner is restrained to the table deep inside Vapid's lair. As Flame screams in a hopeful attempt to awaken Sinnful, Vapid enters and begins her torturous symphony. Clamped tightly Sinnful must endure as Vapid plies her cunt in hopes of extracting her super powers. Meanwhile, Flame can only watch in wide eyed wonder as she awaits her time in Vapid's mighty grip

